import React from "react";


function ItemCount() {
const ChildCallback = ({property, text}) => (
<button onClick={property}>{text}</button>
)

const PropsCallback = () => {
    const handleClick = () => console.log()

    return(
    <>
    <ChildCallback property={handleClick} text='+hola'/>
    <ChildCallback property={handleClick} text='-'/>
    </>
)
}}

export default ItemCount;
